object.script:
buttons = {
	{67, 1, 6, 4},
	{83, 2, 5, 5}
}

is_pressed = {false, false}
function onTick()
	for i, v in ipairs(buttons) do
		t = false
		for j = 1, 2 do
			if input.getBool(j) then
				x, y = input.getNumber(1 + 2 * j) - v[1], input.getNumber(2 + 2 * j) - v[2]
				if 0 <= x and x < v[3] and 0 <= y and y < v[4] then
					t = true
				end
			end
		end
		is_pressed[i] = t
		output.setBool(i, t)
	end
	is_pressed[2] = is_pressed[2] or input.getBool(3)
end

S=screen C=S.setColor
function R(x,y,w,h)S.drawRectF(x,y,w,h)end
function V(x,y,h)R(x,y,1,h)end
function H(x,y,w)R(x,y,w,1)end

function onDraw()
	if is_pressed[1] then C(135,59,6)else C(8,17,27)end R(67,1,6,4)
	if is_pressed[1] then C(1,1,1)else C(171,171,171)end H(70,1,2)V(69,2,2)V(71,1,4)H(70,4,2)

	if is_pressed[2] then C(91,5,5)else C(218,10,10)end R(83,3,5,3)R(84,2,3,5)
	C(147,6,6)R(84,3,4,3)R(84,3,3,4)
	if is_pressed[2] then C(218,10,10)else C(91,5,5)end H(86,4,2)V(87,3,3)H(84,6,3)
	C(87,31,31)V(84,4,1)V(86,4,1)
end

RADIUS = 20^2 TRACKS = { {6837.4, -9123.3}, -- Tenjijo 1 {6847.2, -9128.2, fy=10, set_d=0}, -- Tenjijo 2 {7000.0, -9136.4}, -- Shionagihama 1 {7012.1, -9133.5, fy=-10} -- Shionagihama 2 }
function onTick() gps_x, gps_y = input.getNumber(1), input.getNumber(3) distance = input.getNumber(18)
nrst_d2, nrst_v = nil, nil for _, v in ipairs(TRACKS) do d2 = (gps_x - v[1])^2 + (gps_y - v[2])^2 if nrst_d2 == nil or (d2 <= RADIUS and d2 < nrst_d2) then nrst_d2, nrst_v = d2, v end end nrst_v = nrst_v or {}
for i = 1, 17 do output.setNumber(i, input.getNumber(i)) end output.setNumber(1, distance) output.setNumber(3, nrst_v.fy or 0) output.setNumber(18, nrst_v.set_d or 0) output.setNumber(19, nrst_v.set_d ~= nil and 1 or 0) end
